import React from 'react'
import img1 from './logo512.png';
import PropTypes from 'prop-types';
elementPost.propTypes = {
    title:PropTypes.string.isRequired,
    content:PropTypes.string.isRequired
}
elementPost.defaultProps = {
    title: 'hoang',
    content: 'hoang'
}

export default function elementPost(props) {
    return (
        <div className='mb-4 col'>
            <div className='card text-decoration-none'>
                
                <img src={img1} className="card-img-top" alt="..." />
                <div className="card-body">
                    <h5 style={{ color: 'black' }} className="card-title">{props.title}</h5>
                    <p style={{ color: 'black' }} className="card-text">{props.content}</p>
                    <div className='d-flex justify-content-center align-items-center'>
                        <div className='btn-group' role='group'>
                            <button className='btn btn-primary'>Update</button>
                            <button className='btn btn-secondary'>Delete</button>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}
